import style from "styled-components";

const iconOption = ["person", "shopping_cart"];

const IconList = style.li`
    margin-right: 2.5rem;
    width: 1.563rem;
    cursor: pointer;
`;
const Icons = style.ul`
    align-items: center;
    display: flex;
`;

function OptionsIconHeader() {
    return (
        <Icons>
            {iconOption.map((icon, key) => 
            <IconList key={key}>
                <span class="material-icons">{icon}</span>
            </IconList>)}
        </Icons>
    )
};

export default OptionsIconHeader;
